#!/usr/bin/python
import base64
import os
import sys
sys.path.append('../cat_win')

from cat_win import __version__

CAT_WIN_VERSION = '0.' + __version__
CAT_WIN_VERSION_SEP = CAT_WIN_VERSION.replace('.', ',')
print('Current Version:', CAT_WIN_VERSION, CAT_WIN_VERSION_SEP)


script_dir = os.path.dirname(__file__)
root_dir = os.path.abspath(os.path.join(script_dir, os.pardir))
CATversionFileDIR = os.path.abspath(os.path.join(root_dir, 'temp'))
CATiconfile = os.path.abspath(os.path.join(root_dir, 'temp', 'cat_icon.ico'))
CATWversionFile = os.path.abspath(os.path.join(root_dir, 'temp', 'catwversionfile'))
CATSversionFile = os.path.abspath(os.path.join(root_dir, 'temp', 'catsversionfile'))
print('VersionFile Path:', CATWversionFile)
print('VersionFile Path:', CATSversionFile)

def get_version_file_content(suffix: str) -> str:
    return f"""\
VSVersionInfo(
  ffi=FixedFileInfo(
    filevers=({CAT_WIN_VERSION_SEP}),
    prodvers=({CAT_WIN_VERSION_SEP}),
    mask=0x3f,
    flags=0x0,
    OS=0x40004,
    fileType=0x1,
    subtype=0x0,
    date=(0, 0)
    ),
  kids=[
    StringFileInfo(
      [
      StringTable(
        u'040904B0',
        [StringStruct(u'CompanyName', u''),
        StringStruct(u'FileDescription', u'OS Independent cat Command-line Tool.'),
        StringStruct(u'FileVersion', u'{CAT_WIN_VERSION}'),
        StringStruct(u'InternalName', u'cat_win'),
        StringStruct(u'LegalCopyright', u''),
        StringStruct(u'OriginalFilename', u'cat{suffix}.exe'),
        StringStruct(u'ProductName', u'cat_win'),
        StringStruct(u'ProductVersion', u'{CAT_WIN_VERSION}')])
      ]),
    VarFileInfo([VarStruct(u'Translation', [1033, 1200])])
  ]
)"""

def get_icon_file_content() -> bytes:
    iFc: str = ""
    return base64.b64decode(iFc)

if not os.path.exists(CATversionFileDIR):
    os.makedirs(CATversionFileDIR)

with open(CATiconfile, 'wb') as iF:
    iF.write(get_icon_file_content())

with open(CATWversionFile, 'w', encoding='utf-8') as vF:
    vF.write(get_version_file_content('w'))

with open(CATSversionFile, 'w', encoding='utf-8') as vF:
    vF.write(get_version_file_content('s'))
